import React from 'react'
import "./style.scss";
import gsap from 'gsap';
import {FaGithub} from 'react-icons/fa';
import {GrLinkedin,GrMail} from "react-icons/gr";
import {VscFileSubmodule, VscChecklist,VscAccount,VscArrowUp,VscFeedback} from "react-icons/vsc";



export default function Navbar() {

    var content = document.getElementById("menu");
    var tl = gsap.timeline({defaults:{ease: "power2.inOut"}});
    var toggle = false;
    

    tl.to('menu',{background: '#805ad5'});
    tl.to('menu-btn',{
        'clipPath': 'ellipse(50% 50% at 50% 50%)'
    })
    tl.pause();

    content.addEventListener('click',()=>{
        toggle = !toggle;
        if(toggle ? tl.play(): tl.reverse());
    })



  
    tl.to(content, {xPercent:0})
    
    
    
    
    return (
        <div className="navbar" data-scroll-section>
            <div>
                <ul>
                    <div class='menu' id="menu">
                        Menu
                    </div>
                    <li class="menu-btn" ><VscArrowUp/></li>
                    <li class="menu-btn" ><VscAccount/></li>
                    <li class="menu-btn" ><VscChecklist/></li>
                    <li class="menu-btn" ><VscFileSubmodule/></li>
                    <li class="menu-btn" ><VscFeedback/></li>
                </ul>
            </div>
            <div id="icons">
                <a href="https://github.com/joicejoseph3198" target="_blank" rel="noopener noreferrer"><FaGithub id="git"/></a>
                <a href="https://www.linkedin.com/in/joice-v-joseph-85311a1a1/" target="_blank" rel="noopener noreferrer"><GrLinkedin id="linkd"/></a>
                <a href="your link here" target="_blank" rel="noopener noreferrer"><GrMail id="mail"/></a>
            </div>
        </div>
    )
}
